import React from "react";
import { Container, CardBody, Card } from "reactstrap";

const Skills = props => {
  return (
    <Container>
      <div className="section section-nucleo-icons">
        <Container>
          <h2 className="title" style={{textAlign :'left'}}>Skills</h2>
          <div>
            <div className="icons-container on-screen mt-5">
              {/* Center */}
              <i className="icon tim-icons devicon-javascript-plain" />
              <i className="icon tim-icons devicon-python-plain" />
              <i className="icon tim-icons devicon-c-plain" />
              <i className="icon tim-icons devicon-java-plain" />


              {/* Right 1 */}
              <i className="icon icon-sm tim-icons devicon-nodejs-plain" />
              <i className="icon icon-sm tim-icons devicon-html5-plain" />
              <i className="icon icon-sm tim-icons devicon-css3-plain" />
              {/* Right 2 */}
              <i className="icon tim-icons devicon-android-plain" />
              <i className="icon tim-icons devicon-" />
              <i className="icon tim-icons icon-wifi" />
              {/* Left 1 */}
              <i className="icon icon-sm tim-icons icon-key-25" />
              <i className="icon icon-sm tim-icons icon-atom" />
              <i className="icon icon-sm tim-icons icon-satisfied" />
              {/* Left 2 */}
              <i className="icon tim-icons icon-gift-2" />
              <i className="icon tim-icons icon-tap-02" />
              <i className="icon tim-icons icon-wallet-43" />
            </div>
          </div>
        </Container>
      </div>
    </Container>
  );

}

export default Skills;
